	private static String FONT_FAMILY = "IcoFont";
	private static String TTF = "/icofont.ttf";
	private static double DEFAULT_SIZE = -1;
	private static boolean isLoaded;

	private final char character;

	/**
	 * Private constructor.
	 *
	 * @param character unicode character of the glyph.
	 */
	IcoFont(char character) {
		this.character = character;
	}

	@Override
	public String getName() {
		return this.name();
	}

	@Override
	public char getCharacter() {
		return this.character;
	}

	@Override
	public Glyph get(double size) {
		load();
		return new Glyph(FONT_FAMILY, size, this.character);
	}

	/**
	 * Lazily load the font upon first use.
	 */
	protected static synchronized void load() {
		if (!isLoaded) {
			Font.loadFont(
					IcoFont.class.getResource(TTF).toExternalForm(),
					DEFAULT_SIZE
			);
			isLoaded = true;
		}
	}

	/**
	 * Returns the name of the font family.
	 *
	 * @return the name of the font family.
	 */
	public static String fontFamily() {
		return FONT_FAMILY;
	}

	/**
	 * Returns the glyph font in default size.
	 *
	 * @return the glyph font in default size.
	 */
	public static Font font() {
		return font(DEFAULT_SIZE);
	}

	/**
	 * Returns the glyph font.
	 *
	 * @param size size of the font in pt.
	 * @return the glyph font.
	 */
	public static Font font(double size) {
		load();
		return Font.font(fontFamily(), size);
	}

	/**
	 * Returns a new glyph node in default size, specified by its unicode
	 * character. Keep in mind that a JavaFx node can only occur once in a
	 * scene!
	 *
	 * @param character the unicode character (e.g. {@code '\uf0A8'}).
	 * @return a new glyph node.
	 */
	public static Glyph get(char character) {
		return get(character, DEFAULT_SIZE);
	}

	/**
	 * Returns a new glyph node specified by its unicode character. Keep in mind
	 * that a JavaFx node can only occur once in a scene!
	 *
	 * @param character the unicode character (e.g. {@code '\uf0A8'}).
	 * @param size size of the glyph in pt.
	 * @return a new glyph node.
	 */
	public static Glyph get(char character, double size) {
		load();
		return new Glyph(fontFamily(), size, character);
	}

	/**
	 * Returns a new glyph in default size, specified by its name. Keep in mind
	 * that a JavaFx node can only occur once in a scene!
	 *
	 * @param name name of the glyph.
	 * @return a new glyph node.
	 * @throws IllegalArgumentException if the glyph was not found on the enum.
	 */
	public static Glyph get(String name) {
		return get(getCharacter(name));
	}

	/**
	 * Returns a new glyph specified by its name. Keep in mind that a JavaFx
	 * node can only occur once in a scene!
	 *
	 * @param name name of the glyph.
	 * @param size size of the glyph in pt.
	 * @return a new glyph node.
	 * @throws IllegalArgumentException if the glyph was not found on the enum.
	 */
	public static Glyph get(String name, double size) {
		return get(getCharacter(name), size);
	}

	/**
	 * Returns the unicode character mapped to the given glyph name.
	 *
	 * @param name name of the glyph.
	 * @return the unicode character mapped to the given glyph name.
	 * @throws IllegalArgumentException if the glyph was not found on the enum.
	 */
	public static Character getCharacter(String name) {
		return valueOf(name).getCharacter();
	}

